import React, { useState, useEffect } from "react";
import JornadaService from "../../services/JornadaService";
import { DialogService } from "../../services/DialogService";
import { Table, TableHead, TableRow, TableCell, TableBody, Button, Typography } from "@material-ui/core";

export default function Jornadas(){
  const [jornadas, setJornadas] = useState([]);

  useEffect(() => {
    //Load
  }, []);

  const renderTable = () => {
    if(jornadas.length){
      return(
        <Table aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>Nome</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {jornadas.map((jornada) => (
              <TableRow key={jornada.id}>
                <TableCell align="left">{jornada.nome}</TableCell>
                <TableCell>
                  <Button>
                    Editar
                  </Button>
                  <Button>
                    Excluir
                  </Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      )
    }

    return(<Typography variant="subtitle1">Nenhuma jornada encontrada.</Typography>)
  };

  return (
    <div>

    </div>
  )
}
